body{
    width: 100vw;
    overflow-x: clip;
}
* p, * h1, * h2, * h3{
    cursor: default;
}
.span-heading{
    font-family: 'Inter', sans-serif !important;
    font-size: 50px;
    font-weight: 700;
    line-height: 55px;
    color: #000000;
    text-transform: unset;
    margin: 0;
}
.span-heading span{
    color: white;
}
.green-heading{
    color: #51C0A8;
    font-family: 'Inter', sans-serif !important;
    font-size: 20px;
    font-weight: 400;
    line-height: 25px;
    text-transform: capitalize;
}
* p{
    font-family: 'Roboto', sans-serif !important;
    font-size: 16px;
}
.fa-phone {
    transform: rotate(20deg) !important;
    transition: all 350ms ease-in-out;
}
.center-row {
    align-items: center;
}
header, main, footer {
    overflow-x: clip;
}
.green-btn,
.white-btn,
.purple-btn{
    display: block;
    width: fit-content;
    font-family: 'Inter', sans-serif !important;
    font-size: 15px;
    line-height: 20px;
    font-weight: 500;
    padding: 15px 25px;
    text-decoration: none;
    text-align: center;
    position: relative;
    background-color: transparent;
    overflow: hidden;
    cursor: pointer;
    z-index: 0;
}
.green-btn::before,
.white-btn::before,
.purple-btn::before{
    content: "";
    position: absolute;
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
}
.green-btn::after,
.white-btn::after,
.purple-btn::after{
    content: "";
    position: absolute;
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
    background-color: #2C307D;
    transform: translateX(97%);
    transition: all 150ms ease-in-out;
    z-index: -1;
}
.green-btn:hover::after,
.white-btn:hover::after,
.purple-btn:hover::after{
    transform: translateX(0);
}
.green-btn,
.green-btn:hover,
.purple-btn,
.purple-btn:hover{
    color: #ffffff;
}
.white-btn{
    color: #2C307D;
}
.white-btn:hover{
    color: #ffffff;
}
.green-btn::before{
    background-color: #57D0AF;
}
.white-btn::before{
    background-color: #ffffff;
}
.purple-btn::before{
    background-color: #2C307D;
}
.green-btn::after{
    background-color: #2C307D;
}
.white-btn::after{
    background-color: #51C0A8;
}
.purple-btn::after{
    background-color: #51C0A8;
}
.list-box{
    display: flex;
    flex-direction: row;
    justify-content: flex-start;
    align-items: center;
}
.green-box-img{
    position: relative;
    width: fit-content;
    height: fit-content;
    z-index: 0;
}
.green-box-img::before{
    content: "";
    position: absolute;
    top: 0;
    left: -20px;
    height: 100%;
    width: 100%;
    background-color: #57D0AF;
    z-index: -1;
